import { useEffect, useState } from "react"
import { Container, Row } from "react-bootstrap";
import axios from "axios";
import MovieCard from "./MovieCard";



const Trending = () => {
  const [movies, setMovies] = useState([])
  useEffect(() => {
    axios.get("https://api.themoviedb.org/3/tv/popular?api_key=da9c4514e37d4cd238d6e0205a120ed9&language=en-US&page=1").then(response =>(
      console.log(response.data.resul)
    )).catch(err=>{console.log(err)})
  }, [])


  return (
    <div>
      <Container>
        <br />
        <h1 className="text-white">TRENDING MOVIES</h1>
        <br />
        <Row>
          return <div className="flex pb-5 px-5 overflow-x-auto">
            {movies.map((movie, index) => {
              return <MovieCard key={index} {...movie} />
            })}
          </div>
        </Row>
      </Container>
    </div>
  )
}

export default Trending;
